import { Chart } from 'chart.js/auto'
import { createCanvas } from '@napi-rs/canvas'
import ChartDataLabels, { type Context } from 'chartjs-plugin-datalabels';
import { plugin } from 'bun';

console.log("Hello via Bun!");
Chart.defaults.font.size = 20
Chart.defaults.color = '#f9f6f2'
Chart.defaults.borderColor = '#91908E'

let scale = false;
const BAR_OPTIONS = {
  maintainAspectRatio: false,
  layout: {
    padding: 10,
  },
  scales: {
    x: {
      stacked: true,
    },
    y: {
      stacked: true,
      max: 100,
      ticks: {
        callback: function (val: string, _index: any) {
          return val + '%';
        },
      }
    }
  },
  plugins: {
    title: {
      text: "Line Clear Distribution",
      display: true,
      align: 'start'
    },
    legend: {
      display: true,
      position: 'right',
      reverse: true,
      align: 'start',
      maxWidth: 100 * 7,
    },
  }
};
const WELL_OPTIONS = {
  layout: {
    padding: 10,
  },
  maintainAspectRatio: false,
  scales: {
    y: {
      beginAtZero: true,
      //   max: scale ? Math.max(...stats.wellColumns)/total + 0.04 : 0.4
    }
  },
  plugins: {
    datalabels: {
      color: 'white',
      font: {
        weight: 'bold'
      },
      anchor: 'start',
      align: 'end',
      offset: 20,
      formatter(value: number, _context: Context) {
        return `${Math.round(value * 100)}%`
      }
    }
  }
};
const RADAR_OPTIONS = {
  plugins: {
    datalabels: {
      color: "#f9f6f2",
      borderRadius: 4,
      backgroundColor: function (context: Context) {
        return context.dataset.backgroundColor;
      },
      borderWidth: 1,
      borderColor: function (context: Context) {
        return context.dataset.borderColor;
      },
      align: 'end',
    }
  },
  layout: {
    padding: 20
  },
  devicePixelRatio: 4,
  elements: {
    line: {
      borderWidth: 3
    }
  },
  scales: {
    r: {
      beginAtZero: true,
      max: 1,
      ticks: {
        display: false,
        maxTicksLimit: 20
      }
    }
  },
}

const test = "data:image/png;base64,";



Bun.serve({
  async fetch(req) {

    let graphData = await req.json();
    //console.log(graphData);

    const url = new URL(req.url);
    const width = Number(url.searchParams.get('width'));
    const height = Number(url.searchParams.get('height'));

    let canvas: any = createCanvas(width, height);


    // let combinedCanvas = createCanvas(200 * 1 * 4, 200 * 4);
    // let combinedCanvasCtx = combinedCanvas.getContext('2d')

    let set: any = {
      type: graphData.type,
      data: graphData.data,
    };

    switch (graphData.optionType) {
      case "well":
        set.options = WELL_OPTIONS;
        set.plugins = [ChartDataLabels];
        set.options.scales.y.max = graphData.scaleYMax;
        break;
      case "bar":
        set.options = BAR_OPTIONS;
        break;
      case "radar":
        set.plugins = [ChartDataLabels];
        set.options = RADAR_OPTIONS;
        set.options.plugins.datalabels.formatter = function (value: any, context: { dataIndex: any }) {
          let min = graphData.min[context.dataIndex];
          let max = graphData.max[context.dataIndex];
          let range = max - min;
          let trueValue = value * range + min;

          switch (graphData.formatTypes[context.dataIndex]) {
            case "toFixed2":
              return String(trueValue.toFixed(2));
            case "round":
              return String(Math.round(trueValue));
            case "percentage":
              return `${Math.floor(trueValue * 100)}%`;
            case "percentageToFixed2":
              return `${((trueValue * 100).toFixed(2))}%`;
            default:
              return "err";
          }

        }
        break;

    }

    console.log(canvas);

    // return new Response(test);
    let chart = new Chart(canvas, set);

    var ctx = canvas.getContext("2d");

    ctx.globalCompositeOperation = 'destination-over'

    ctx.fillStyle = "#292929";
    ctx.beginPath();
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    let base64Image = canvas.toDataURL("image/png");

    ctx.clearRect(0, 0, canvas.width, canvas.height);


    canvas.width = 1;
    canvas.height = 1;
    chart.resize(1, 1);
    chart.clear();
    chart.destroy();

    return new Response(base64Image);
  },
  port: 8084
});

